import React, { useEffect, useState } from 'react';

const Doggie = () => {
    const url = "https://api.thedogapi.com/v1/images/search?limit=16";
    const [data, setData] = useState();
    useEffect(() => {
        fetch(url).then((response) => response.json()).then((resJson) => { setData(resJson[0].url) })
            .catch((err) => console.log('error'))
    }, [])
    return (
        <>
            <div className="App">
            {data && data.map((dog) => <img width={"200px"} height={"200px"} src={dog}></img>)}
            </div>
        </>
    );
}

export default Doggie;
